$(document).ready(function(){$("#sections").on("change",function(){var e="https://api.nytimes.com/svc/topstories/v2/"+$("#sections").val()+".json";e+="?"+$.param({"api-key":"516e14d87c8e478195abbd4aaa72b938"}),$(".logo img").css({height:"5rem",width:"5rem"}),$("#stories ul li").remove(),$.ajax({url:e,method:"GET"}).done(function(e){var i=e.results.slice(0,12);console.log(i);var t=i.filter(function(e){return e.multimedia.length});$.each(t,function(e,i){$("#stories > ul").append('<li><a href="'+i.url+'"target="_blank"><div class="storywrapper"><div class="imageurl" style="background-image:url('+i.multimedia[4].url+')"><div class="story-text"><p>'+i.abstract+"</p></div></div></div></a></li>")})}).fail(function(e){throw e})})});